import React from 'react';

import Reloj from '../Reloj';
import Mapa from '../Mapa';
import Servicios from './Servicios';
import Moviles from './Moviles';

import './index.css';

const MonitorFrecuencia = () => {
  const [ moviles, setMoviles ] = React.useState([])
  const handleChange = (moviles) => {
      console.log(moviles);
      setMoviles(moviles);
  }

  const rutas = [
    'http://latinsoft.cl/archivos/circuitos/antofagasta/linea104/RUTA_104_IDA.kml', 
    'http://latinsoft.cl/archivos/circuitos/antofagasta/linea104/RUTA_104_REG.kml'
  ];

  return (
    <div className="row">
        <div className="col s4">
            <Reloj />
            <Mapa moviles={ moviles } rutas={rutas} />
        </div>
        <div className="col s8">
            <Servicios />
            <Moviles handleChange={ handleChange }/>
        </div>       
    </div>
  );
}

export default MonitorFrecuencia;
